A story behind the scenes;

To achieve this youthful glossy and rosy pink look, we combined some of our favourite products that needed to be moisturizing, soft but buildable in colors, luminous, yet catches the studio lights perfectly.
üå∏üå∏ Vina;
With her look, it translated as something that is almost grungy yet still feminine to compliment the beauty of quirkiness with her gesture and look, loosely inspired by the oriental beauty of Japanese women
üåπüåπ Debora;
Dewy and ethereal, yet innocent beauty is embodied through her expressive eyes and clean-cut look from her overall facial structure and gesture

They were all wearing the same makeup concept that translated differently on each other,
all inspired by @jordanliberty's iconic glossy eyes and the work of @juliamartinsmiranda

All the credit goes out to these amazing products and people involved in the shoot; 
